import React, { useState } from "react";
import Header from "./components/shared/Header";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./components/Home";
import { AppContextProvider, AppContextInitialState, IAppContext } from "./context/AppContext";
import Login from "./components/account/Login";
import Register from "./components/account/Register";
import SubjectCreate from "./components/views/subject/SubjectCreate";
import SubjectDetails from "./components/views/subject/SubjectDetails";
import SubjectIndex from "./components/views/subject/SubjectIndex";
import TeacherIndex from "./components/views/persons/TeacherIndex";
import TeacherSubjectIndex from "./components/views/subject/TeacherIndex";
import StudentSubjectIndex from "./components/views/studentsubject/Index";
import HwTeacherIndex from "./components/views/homeworks/TeacherIndex";
import CreateHomework from "./components/views/homeworks/CreateHomework";
import EditHomework from "./components/views/homeworks/EditHomework";
import StudentHwTeacherIndex from "./components/views/studenthomeworks/TeacherIndex";
import StudentHwDetails from "./components/views/studenthomeworks/Details";
import SubjectIndexStudent from "./components/views/subject/StudentIndex";
import HomeworkStudentIndex from "./components/views/homeworks/StudentIndex";
import StudentHwStudentIndex from "./components/views/studenthomeworks/StudentIndex";

const App = () => {
    const setJwt = (jwt: string) => {
        setAppState({...appState, jwt: jwt});
    }

    const setUserName = (userName: string) => {
        setAppState({...appState, userName: userName});
    }

    const setUserRole = (userRole: string) => {
        setAppState({...appState, userRole: userRole});
    }

    const initialAppState = {
        ...AppContextInitialState,
        setJwt,
        setUserName,
        setUserRole,
    } as IAppContext;
    const [appState, setAppState] = useState(initialAppState);

    return (
    <AppContextProvider value={appState}>
        <Router>
            <Header />
            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>
                <Route path="/home">
                    <Home />
                </Route>
                <Route path="/subjects/create">
                    <SubjectCreate />
                </Route>
                <Route path="/subject/:id">
                    <SubjectDetails />
                </Route>
                <Route path="/subjects">
                    <SubjectIndex />
                </Route>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/register">
                    <Register />
                </Route>
                <Route path="/teacherss">
                    <TeacherIndex />
                </Route>
                <Route path="/teacherssubjects">
                    <TeacherSubjectIndex />
                </Route>
                <Route path="/studentsubjectindex/:subjectid">
                    <StudentSubjectIndex />
                </Route>
                <Route path="/hwteacherindex/:id">
                    <HwTeacherIndex />
                </Route>
                <Route path="/createhomework/:id">
                    <CreateHomework />
                </Route>
                <Route path="/edithomework/:id">
                    <EditHomework />
                </Route>
                <Route path="/studenthwteacher/:id">
                    <StudentHwTeacherIndex />
                </Route>
                <Route path="/studenthwdetails/:id">
                    <StudentHwDetails />
                </Route>
                <Route path="/studentsubjects/:email">
                    <SubjectIndexStudent />
                </Route>
                <Route path="/hwstudentindex/:id">
                    <HomeworkStudentIndex />
                </Route>
                <Route path="/hwstudentdetails/:id">
                    <StudentHwStudentIndex />
                </Route>
                <h1>404</h1>
            </Switch>
        </Router>
    </AppContextProvider>
    );
};

export default App;
